*/


import './App.css';
import Chessboard from './components/Chessboard/chessboard';
import TakenPiece from './components/TakenPiece/TakenPiece';
import { TeamType, Piece, PieceType } from './constants';
import SuperPiece from './superPiece';


const piece = {SuperPiece : new SuperPiece([PieceType.KING, PieceType.QUEEN, PieceType.ROOK, 
  PieceType.BISHOP, PieceType.NIGHT, PieceType.PAWN], TeamType.WHITE), x : 0, y : 0}

function App() {
  return (
      <div id = 'App'>
        <TakenPiece piece = {piece}></TakenPiece>
        <Chessboard></Chessboard>
      </div>
  );
}

export default App;
